import React, { Component, Fragment } from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Card from "@material-ui/core/Card";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Button from "@material-ui/core/Button";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemAvatar from "@material-ui/core/ListItemAvatar";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemSecondaryAction from "@material-ui/core/ListItemSecondaryAction";
import ListItemText from "@material-ui/core/ListItemText";
import Avatar from "@material-ui/core/Avatar";
import IconButton from "@material-ui/core/IconButton";
import FormGroup from "@material-ui/core/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Checkbox from "@material-ui/core/Checkbox";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import FolderIcon from "@material-ui/icons/Folder";
import DeleteIcon from "@material-ui/icons/Delete";
import { Timeline, Event } from "react-timeline-scribble";

import "./components.css";

export default class About extends Component {
  render() {
    const classes = makeStyles(theme => ({
      root: {
        flexGrow: 1
      },
      paper: {
        padding: theme.spacing(2),
        textAlign: "center",
        color: theme.palette.text.secondary
      }
    }));
    // const [dense, setDense] = React.useState(false);
    // const [secondary, setSecondary] = React.useState(false);

    return (
      <div>
        <div class="about" id="about">
          <div className={classes.root}>
            <Grid container spacing={3}>
              <Grid item xs={4}>
                <Paper className={classes.paper}>
                  <Fragment>
                    <h1>EDUCATION</h1>
                    <Timeline>
                      <Card>
                        <Event
                          interval={"2013 – 2017"}
                          title={"Thomas Jefferson HSST"}
                          subtitle={"Student"}
                        >
                          <img
                            src={require("../images/tj.jpg")}
                            className="tjuva"
                          />
                        </Event>
                      </Card>
                      <Card className="education">
                        <Event
                          interval={"2017 – 2021"}
                          title={"University of Virginia"}
                          subtitle={"SEAS - Computer Science & Statistics"}
                        >
                          <img
                            src={require("../images/uva2.jpg")}
                            className="tjuva"
                          />
                        </Event>
                      </Card>
                    </Timeline>
                  </Fragment>
                </Paper>
              </Grid>
              <Grid item xs={4} md={4}>
                <Grid container spacing={0}>
                  <Paper className={classes.paper}>
                    <h1>RELEVANT COURSES</h1>
                    <Grid item xs={6} md={6}>
                      <Typography variant="h6" className={classes.title}>
                        TJHSST
                      </Typography>
                      <List>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="AP Computer Science" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Artificial Intelligence 1 & 2" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Mobile App Development" />
                        </ListItem>
                      </List>
                    </Grid>
                    <Grid item xs={6} md={6}>
                      <List>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="AP Computer Science" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Artificial Intelligence 1 & 2" />
                        </ListItem>
                        <ListItem>
                          <ListItemAvatar>
                            <img
                              src={require("../images/tj.jpg")}
                              className="avatar"
                            />
                          </ListItemAvatar>
                          <ListItemText primary="Mobile App Development" />
                        </ListItem>
                      </List>
                    </Grid>
                  </Paper>
                </Grid>
              </Grid>
              <Grid item xs={4}>
                <Paper className={classes.paper}>
                  <h1>TECHNICAL SKILLS</h1>
                </Paper>
              </Grid>
            </Grid>
          </div>
        </div>
      </div>
    );
  }
}
